      (7000, '核心測驗美食店7000', 3, 45, 10, '腸胃無負擔、熱量減少。', '五月雪保留客家料理的精髓，但在口味上趨近清淡所以店內113餘道客家菜風味道地，又可口也不會太油又太鹹。店內的菜色很多元，兼具傳統與創新， 除了必嘗的外婆醬肉、白斬放山雞、醬筍炆鮮魚、和風鹹豬肉之外，想來點不同的還可以點選店家的私房菜，依四季調整的當季食材，每每總讓人驚豔。我們菜色上不僅求新求變，還要不失客家風味，而且還要好吃。所以師傅們就得花更多的工序與心思在菜色上，讓菜色更加美味。 「我們嚴選台灣各地上等的食材，將最好的料理奉獻給客人，讓客人下次繼續光顧，是我們的服務理念。」', '24.107787,120.638094', '0X16-0X2-XX5', '台中市烏日區XX路XX巷XX樓', 'XX公車站走路8分鐘！！', '隔週星期天公休', '17:00~28:00', '可包廂、可預約', '2018-05-14 20:19:00', '2018-05-14 20:19:00'),
